sys_variable_value.value:
(function execute(inputs, outputs) {
    
    var api = new x_neyu_modtrak.ModTrakAPI();

    const response = api.status(
        inputs.changeNumber,
        inputs.approveHistory
    );

    outputs.error = response.error;
    outputs.error_message = response.errorMessage
    outputs.status = response.result;
    
})(inputs, outputs);

